import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";

const Explore = () => {
  const [skills, setSkills] = useState([]);
  const [formData, setFormData] = useState({
    name: "",
    description: "",
    timeCreditValue: "",
    availableHours: "",
    googleMeetLink: "",
  });

  const navigate = useNavigate();

  useEffect(() => {
    fetchSkills();
  }, []);

  const fetchSkills = async () => {
    try {
      const response = await fetch("http://localhost:5000/api/skills");
      const data = await response.json();
      setSkills(data);
    } catch (error) {
      console.error("Error fetching skills:", error);
    }
  };

  // ✅ Handle Form Change
  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  // ✅ Handle Form Submission
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const token = localStorage.getItem("token");
      const response = await fetch("http://localhost:5000/api/skills", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer ${token}`,
        },
        body: JSON.stringify(formData),
      });

      if (response.ok) {
        alert("Course added successfully!");
        setFormData({
          name: "",
          description: "",
          timeCreditValue: "",
          availableHours: "",
          googleMeetLink: "",
        });
        fetchSkills(); // Refresh the list of skills
      } else {
        const errorData = await response.json();
        alert(errorData.message);
      }
    } catch (error) {
      console.error("Error adding course:", error);
    }
  };

  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold text-purple-700 mb-4">Explore Courses</h2>

      {/* ✅ Add New Course Form */}
      <form onSubmit={handleSubmit} className="bg-white shadow-md rounded-lg p-6 mb-6">
        <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
          <input
            type="text"
            name="name"
            value={formData.name}
            onChange={handleChange}
            placeholder="Course Name"
            className="border p-2 rounded w-full"
            required
          />
          <input
            type="text"
            name="description"
            value={formData.description}
            onChange={handleChange}
            placeholder="Description"
            className="border p-2 rounded w-full"
            required
          />
          <input
            type="number"
            name="timeCreditValue"
            value={formData.timeCreditValue}
            onChange={handleChange}
            placeholder="Credit Value"
            className="border p-2 rounded w-full"
            required
          />
          <input
            type="number"
            name="availableHours"
            value={formData.availableHours}
            onChange={handleChange}
            placeholder="Available Hours"
            className="border p-2 rounded w-full"
            required
          />
          <input
            type="text"
            name="googleMeetLink"
            value={formData.googleMeetLink}
            onChange={handleChange}
            placeholder="Google Meet Link"
            className="border p-2 rounded w-full"
            required
          />
        </div>
        <button
          type="submit"
          className="mt-4 bg-purple-600 text-white px-4 py-2 rounded hover:bg-purple-700"
        >
          Add Course
        </button>
      </form>

      {/* ✅ Display Courses */}
      {skills.length > 0 ? (
        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
          {skills.map((skill) => (
            <div
              key={skill._id}
              className="bg-white shadow-lg rounded-lg p-4 hover:shadow-xl transition duration-300"
              onClick={() => navigate(`/skill/${skill._id}`)}
            >
              <h3 className="text-xl font-bold text-gray-800">{skill.name}</h3>
              <p className="text-gray-600">{skill.description}</p>
              <p className="text-sm text-gray-500 mt-2">
                Created by: {skill.user?.name || "Unknown"}
              </p>
              <p className="text-sm text-gray-500 mt-1">
                Time Credit Value: {skill.timeCreditValue}
              </p>
            </div>
          ))}
        </div>
      ) : (
        <p className="text-gray-500">No courses available yet.</p>
      )}
    </div>
  );
};

export default Explore;
